import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { Link ,useParams } from 'react-router-dom';
import { toast, Flip } from 'react-toastify';

export default function Indexadddichvukham() {
    const [data, setData] = useState([]);

    const { id_lich_kham } = useParams();

    const loadData = async () => {
        const response = await axios.get("http://localhost:5000/api/getallgdv");
        setData(response.data);
    };

    useEffect(() => {
        loadData();
    }, []);

    const handleSearch = async (e) => {
        const searchTerm = e.target.value;
        if (!searchTerm) {
            loadData();
        } else {
            try {
                const response = await axios.get(`http://localhost:5000/api/searchgdv/${searchTerm}`);
                setData(response.data);
            } catch (error) {
                console.error("Error searching data", error);
            }
        }
    };

    const formatCurrency = (number) => {
        return new Intl.NumberFormat('vi-VN', { style: 'currency', currency: 'VND' }).format(number);
    };

    return (
        <div className="card shadow mb-4">
            <div className="d-flex align-items-center justify-content-between card-header py-3">
                <h6 className="m-0 font-weight-bold text-primary">
                    <Link to={`/Indexadddichvukham/${id_lich_kham}`} className="link-effect text-decoration-none">Tất cả dịch vụ</Link> /
                    <Link to={`/Indexadddichvukhamtheochuyenkhoa/${id_lich_kham}`} className="link-effect text-decoration-none">Dịch vụ theo chuyên khoa đã đặt</Link>
                </h6>
            </div>
            <div className="card-body">
                <div className="table-responsive">
                    <table className="table table-bordered" id="dataTable" width="100%" cellSpacing="0">
                        <thead>
                            <tr>
                                <th>STT</th>
                                <th>Hình ảnh</th>
                                <th>Tên dịch vụ</th>
                                <th>Giá</th>
                                <th>Chi tiết dịch vụ</th>
                                <th>Lựa chọn</th>
                            </tr>
                        </thead>
                        <tbody>
                            {data.map((item, index) => {
                                return (
                                    <tr key={item.id_dich_vu}>
                                        <td>{index+1}</td>
                                        <td><img style={{ borderRadius: '5px' }} src={item.hinh_anh_dv} width='60' height='60' className="img img-responsive" /></td>
                                        <td>{item.ten_dich_vu}</td>
                                        <td>{formatCurrency(item.gia)}</td>
                                        <td><Link to={`/Viewgdv/${item.id_dich_vu}`} type="button" className="btn btn-primary">Chi Tiết</Link></td>
                                        <td>
                                            <input type="checkbox" value={item.id_dich_vu} />
                                        </td>
                                    </tr>
                                )
                            })}
                        </tbody>
                    </table>
                </div>
                <div className="row">
                    <div className="d-grid">
                        <button style={{ marginLeft: '10px', marginTop:'20px' }} type="submit" className="btn btn-primary">Thêm dịch vụ khám sử dụng</button>
                    </div>
                </div>
            </div>
        </div>
    );
}
